import React from 'react';

function Grid({ robotPosition }) {
    const div_id=(robotPosition.x+(robotPosition.y*5));
    const func_setstyle=(id)=>{
        if(id==div_id)
        {
            return "game-screen__cell flex items-center justify-center w-20 h-20 border-amber-800 border-2 bg-green-500 hover:bg-opacity-75 duration-300"
        }
        else
        {
            return "game-screen__cell flex items-center justify-center w-20 h-20 border-amber-800 border-2 bg-amber-500 hover:bg-opacity-75 duration-300"
        }
    };
  return (
    <div className='flex '>
        <div className=''>
        <div className="flex">
            <div id="1" className={func_setstyle("1")}>
                {div_id=="1"?<div><svg width="45" height="45" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg"><rect width="48" height="48" fill="white" fill-opacity="0.01"/><rect x="9" y="18" width="30" height="24" rx="2" fill="none" stroke="#333" stroke-width="1"/><circle cx="17" cy="26" r="2" fill="#333"/><circle cx="31" cy="26" r="2" fill="#333"/><path d="M20 32C18.8954 32 18 32.8954 18 34C18 35.1046 18.8954 36 20 36V32ZM28 36C29.1046 36 30 35.1046 30 34C30 32.8954 29.1046 32 28 32V36ZM20 36H28V32H20V36Z" fill="#333"/><path d="M24 10V18" stroke="#333" stroke-width="1" stroke-linecap="round" stroke-linejoin="round"/><path d="M4 26V34" stroke="#333" stroke-width="1" stroke-linecap="round" stroke-linejoin="round"/><path d="M44 26V34" stroke="#333" stroke-width="1" stroke-linecap="round" stroke-linejoin="round"/><circle cx="24" cy="8" r="2" stroke="#333" stroke-width="1"/></svg></div>:<div></div>}
            </div>
            <div id="2" className={func_setstyle("2")}>
                {div_id=="1"?<div><svg width="45" height="45" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg"><rect width="48" height="48" fill="white" fill-opacity="0.01"/><rect x="9" y="18" width="30" height="24" rx="2" fill="none" stroke="#333" stroke-width="1"/><circle cx="17" cy="26" r="2" fill="#333"/><circle cx="31" cy="26" r="2" fill="#333"/><path d="M20 32C18.8954 32 18 32.8954 18 34C18 35.1046 18.8954 36 20 36V32ZM28 36C29.1046 36 30 35.1046 30 34C30 32.8954 29.1046 32 28 32V36ZM20 36H28V32H20V36Z" fill="#333"/><path d="M24 10V18" stroke="#333" stroke-width="1" stroke-linecap="round" stroke-linejoin="round"/><path d="M4 26V34" stroke="#333" stroke-width="1" stroke-linecap="round" stroke-linejoin="round"/><path d="M44 26V34" stroke="#333" stroke-width="1" stroke-linecap="round" stroke-linejoin="round"/><circle cx="24" cy="8" r="2" stroke="#333" stroke-width="1"/></svg></div>:<div></div>}
            </div>
            <div id="3" className={func_setstyle("3")}></div>
            <div id="4" className={func_setstyle("4")}></div>
            <div id="5" className={func_setstyle("5")}></div>
        </div>
        <div className="flex ">
            <div id="6" className={func_setstyle("6")}></div>
            <div id="7" className={func_setstyle("7")}></div>
            <div id="8" className={func_setstyle("8")}></div>
            <div id="9" className={func_setstyle("9")}></div>
            <div id="10" className={func_setstyle("10")}></div>
        </div>
        <div className="flex ">
            <div id="11" className={func_setstyle("11")}></div>
            <div id="12" className={func_setstyle("12")}></div>
            <div id="13" className={func_setstyle("13")}></div>
            <div id="14" className={func_setstyle("14")}></div>
            <div id="15" className={func_setstyle("15")}></div>
        </div>
        <div className="flex ">
            <div id="16" className={func_setstyle("16")}></div>
            <div id="17" className={func_setstyle("17")}></div>
            <div id="18" className={func_setstyle("18")}></div>
            <div id="19" className={func_setstyle("19")}></div>
            <div id="20" className={func_setstyle("20")}></div>
        </div>
        <div className="flex ">
            <div id="21" className={func_setstyle("21")}></div>
            <div id="22" className={func_setstyle("22")}></div>
            <div id="23" className={func_setstyle("23")}></div>
            <div id="24" className={func_setstyle("24")}></div>
            <div id="25" className={func_setstyle("25")}></div>
        </div>
        </div>

        
    </div>
    
  );
}

export default Grid;
